import { BrowserRouter, Routes, Route } from "react-router-dom";

import Home from "./views/Home";
import Destinos from "./views/destino";
import DestinosCreate from "./views/destino/Create";
import Passageiros from "./views/passageiro";
import PassageirosCreate from "./views/passageiro/Create";
import Menu from "./components/Menu";
import Footer from "./components/Footer";

import "./style.css";

function App() {
  return (
    <BrowserRouter>
      <main>
        <Menu />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/Destino" element={<Destinos />} />
          <Route path="/Destino-Create" element={<DestinosCreate />} />
          <Route path="/Destino-Update/:id" element={<DestinosCreate />} />          
          <Route path="/Passageiro" element={<Passageiros />} />
          <Route path="/Passageiro-Create" element={<PassageirosCreate />} />
          <Route path="/Passageiro-Update/:id" element={<PassageirosCreate />} />
        </Routes>
      </main>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
